import * as React from 'react';
import { Paper } from '@mui/material';
const
    Header = () => {
        return (
            <header>
                <Paper elevation={0}/>
                <ul>
                    <li><a class="menuItem" href="https://www.linkedin.com/in/james-platt-b7670b221" target="_blank">JamesPlatt</a></li>
                    <li><a class="menuItem" href="#aboutMe">About</a></li>
                    <li><a class="menuItem" href="#projects">Projects</a></li>
                    <li><a class="menuItem" href="#resume">Experience</a></li>
                    <li><a class="menuItem" href="#contact">Contact</a></li>
                    <li><a class="pointer darkLight menuItem">Dark/Light</a></li>
                </ul>
            </header>
        )
    }

export {
    Header
};
